import logo from './logo.svg';
import './App.css';
import {Router,Route} from 'react-router-dom';
import TotalSalesTable from './components/TotalSalesTable';

function App() {
  return (
    <Router>
      <Route path ="/sales/:vendorId" Component={TotalSalesTable}/>
    </Router>
  );
}

export default App;
